import { useState } from 'react';
import './App.scss';

function App() {
  const [quote, setQuote] = useState("If you do what you’ve always done, you’ll get what you’ve always gotten.");

  let author = "hello";

  return (
    <div className="App">
      <header className="App-header">
        <p>
          {quote}
        </p>
        <p>
          {author}
        </p>
        <button onClick={() => setQuote("balls")}>Change Quote</button>
      </header>
    </div>
  );
}

export default App;
